import React, { Component } from "react";
import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { connect } from "react-redux";
import { loadProjects } from "./actions/projectActions";
import { loadBugs } from "./actions/bugActions";

import PageHeader from "./components/pageHeader";
import PageContent from "./containers/pageContent";
import PageSidebar from "./components/pageSidebar";
import SplashScreen from "./components/splashScreen";

class App extends Component {
  render() {
    return (
      // <div>
      <Router>
        <Route exact path="/login" component={SplashScreen} />
        <Route exact path="/" component={PageContent} />

        {/* <div>
          <PageHeader />
        </div>
        <div className="page-main">
          <PageSidebar />
          <PageContent />
        </div> */}
        {/* </div> */}
        <Route path="*">{/* TODO: Not found component/page */}</Route>
      </Router>
      // TODO: Add logic to determine if user is logged in or not and show splash screen if not
    );
  }

  componentDidMount() {
    this.props.loadProjects();
    this.props.loadBugs();
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    loadProjects: () => dispatch(loadProjects()),
    loadBugs: () => dispatch(loadBugs()),
  };
};

export default connect(null, mapDispatchToProps)(App);
